KOHEI YOSHIIとLaure-lという2人の日本人によるJazzy beats「Gulf Coastline」が今日Chill Selectよりリリース！

クールに熱いドラムとラウンジ感のあるピアノ、そして壮大なアンビエンスを楽しんでください。

熱い夏を冷やすにはこの曲しかない！

